import React, { useState } from "react";
import "./App.css";

function App() {
  const [query, setQuery] = useState("");
  const [mode, setMode] = useState("lexical");
  const [results, setResults] = useState([]);
  const [answer, setAnswer] = useState("");
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");
  const [searchTime, setSearchTime] = useState(null); // 검색 소요 시간 상태

  const handleSearch = async () => {
    setLoading(true);
    setError("");
    setResults([]);
    setAnswer("");
    setSearchTime(null);

    const startTime = performance.now(); // 검색 시작 시간

    try {
      const response = await fetch("http://localhost:3000/search", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ query, mode }),
      });

      const data = await response.json();

      if (response.ok) {
        setResults(data.results);
        if (mode === "rag") setAnswer(data.answer || "No answer provided.");
      } else {
        setError(data.error);
      }
    } catch {
      setError("Failed to connect to the server.");
    } finally {
      const endTime = performance.now(); // 검색 종료 시간
      setSearchTime((endTime - startTime).toFixed(2)); // 소요 시간 (ms 단위, 소수점 2자리)
      setLoading(false);
    }
  };

  // Enter 키를 눌렀을 때 검색 실행
  const handleKeyPress = (e) => {
    if (e.key === "Enter" && !loading) {
      handleSearch();
    }
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>Movie Search</h1>
        <div className="container">
          <div className="search-container">
            <input
              type="text"
              value={query}
              onChange={(e) => setQuery(e.target.value)}
              onKeyPress={handleKeyPress}
              placeholder="Enter your query..."
              className="search-box"
            />
            <button
              onClick={handleSearch}
              disabled={loading}
              className="search-button"
            >
              {loading ? "Searching..." : "Search"}
            </button>
          </div>
          <div className="search-modes">
            <label>
              <input
                type="radio"
                value="lexical"
                checked={mode === "lexical"}
                onChange={(e) => setMode(e.target.value)}
              />
              Lexical Search
            </label>
            <label>
              <input
                type="radio"
                value="hybrid"
                checked={mode === "hybrid"}
                onChange={(e) => setMode(e.target.value)}
              />
              Hybrid Search
            </label>
            <label>
              <input
                type="radio"
                value="rag"
                checked={mode === "rag"}
                onChange={(e) => setMode(e.target.value)}
              />
              RAG Search
            </label>
          </div>
        </div>

        {searchTime !== null && (
          <p className="search-time">
            Search completed in {searchTime} ms.
          </p>
        )}
        {error && <p className="error">{error}</p>}
        {mode === "rag" && answer && (
          <div>
            <h2>Generated Answer</h2>
            <div dangerouslySetInnerHTML={{ __html: answer }} />
          </div>
        )}
        {results.length > 0 && (
          <table className="results-table">
            <thead>
              <tr>
                <th>Title</th>
                <th>Plot</th>
                <th>Full Plot</th>
                <th>Similarity / Score</th>
              </tr>
            </thead>
            <tbody>
              {results.map((result) => (
                <tr key={result._id}>
                  <td>{result.title}</td>
                  <td>{result.plot || "N/A"}</td>
                  <td>{result.fullplot || "N/A"}</td>
                  <td>
                    {result.similarity !== undefined
                      ? result.similarity.toFixed(4)
                      : result.score !== undefined
                      ? result.score.toFixed(4)
                      : "N/A"}
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </header>
    </div>
  );
}

export default App;
